    "props": {
        "align-content": {
            "type": "string"
        },
        "offset-right": {
            "type": "string"
        },
        "wrap-style": {
            "type": "string"
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "_viewModelId": "AwFlexColumn",
    "_uniqueViewModelId": "AwFlexColumn",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awFlexColumnRenderFunction, undefined, ctxImportObj );

export default Component;
